import React, { Component } from 'react';
import "./index.css";
import { NavLink } from "react-router-dom";

const activeStyle = {
  color: "red"
};

class Header extends Component {
  constructor(props) {
    super(props);
    this.state = {
      about: false,
      speaker: false,
      workshops: false,
      register: false,
      tShirt: false,
      contact: false
    }
  };
  setAbout = () => {
        this.setState({
          about: true,
          speaker: false,
          workshops: false,
          register: false,
          tShirt: false,
          contact: false
        });
        console.log("hello");
  };

  seeState = () => {
    console.log(this.state.about);
    console.log(this.state.speaker);
    console.log(this.state.workshops);
    console.log(this.state.register);
    console.log(this.state.tShirt);
    console.log(this.state.contact);
  };


  render() {
    return (
      <div className="headerDiv">
        <div className="navLinks">
          <div className="row" id="navLinks">
            <div className="col m2">
              <NavLink to="/About" activeStyle={activeStyle} onClick={this.setAbout}>About</NavLink>
            </div>
            <div className="col m2">
              <a href="/About" onClick={() => this.setActiveLink("speaker")}>Our Speaker</a>
              </div>
            <div className="col m2">
              <a href="/About" onClick={() => this.setActiveLink("workshops")}>Workshops</a>
            </div>
            <div className="col m2">
              <a href="/About" onClick={() => this.setActiveLink("register")}>Register</a>
            </div>
            <div className="col m2">
              <a href="/About" onClick={() => this.setActiveLink("tShirt")}>T-Shirt Design</a>
            </div>
            <div className="col m2">
              <a href="/About" onClick={() => this.setActiveLink("contact")}>Contact</a>
            </div>
          </div>
        </div>
        <div className="titleDiv">
          <div className="row">
            <div className="col s12 m4">
              <h5>Winter Retreat <span>2018</span></h5>
              <p>Perseverance</p>
              <p id="verse">2 Timothy 4:7</p>
            </div>
            <div className="col s12 m4">
            </div>
            <div className="col s12 m4" id="headerDesc">
              <p>Cohutta Springs Conference Center</p>
              <p id="date">December 28-31 &nbsp;<span>2018</span></p>
            </div>
          </div>
        </div>
        <a onClick={this.seeState}>Check State</a>
      </div>
    )
  };
};

export default Header;
